lulzbot.com/about-lulzbot-3d-printers to learn more about how to add the best 3D printing experience to your tool box.\n\nSee all of Landon Meier's masks and creations at http://hyperflesh.com/.\n\n\n Seen in This Video \nLulzBot TAZ 6 3D Printer: https://www.lulzbot.com/store/printers/lulzbot-taz-6\nLulzBot Mini 3D Printer: https://www.lulzbot.com/store/printers/lulzbot-mini\nPolyLite PLA by Polymaker: https://www.lulzbot.com/store/filament/polylite-pla\nnGen by colorFabb: https://www.lulzbot.com/store/filament/ngen\n\n Cura LulzBot Edition \nOur Cura LulzBot Edition slicing software includes profiles for over 30 different filament types, making operation as easy as Load, Click, and Print. Download for free today at https://LulzBot.com/Cura\n\n About LulzBot 3D Printers \nYour ideas change the world. Dream it, draw it, and let LulzBot 3D Printers make it a reality. Curiosity turns into prototypes, standards are tested, and production-grade parts are made right there at your desk.\n\n Stability Comes Standard \nLulzBot 3D Printers are the most dependable on the planet because reliability isnt just expected, its perfected. How? We use our printers to make parts for more printers, with over 2 million production-grade parts and counting. Why? Your business, your school, your passion cant flourish when your technology needs repairs. Neither can ours. \n\nLulzBot hardware is made in the USA using domestic and imported parts. Our unwavering commitment to quality means your equipment will be enjoyed for years to come with minimal maintenance.\n\nGet fast and friendly help whenever you need it from our industry leading \u0026 Colorado-based technical support team: LulzBot.com/Support\n\nLearn more at https://www.lulzbot.com/about-lulzbot-3d-printers.\n\n\n Find Us Online \nSubscribe for more 3D printing tips, tricks, and tutorials: https://www.youtube.com/subscription_center?add_user=LulzBotVideo\nInstagram: https://www.instagram.com/lulzbot3d/\nFacebook: https://www.facebo  on the planet because reliability isnt just expected, its perfected. How? We use our printers to make parts for more printers, with over 2 million production-grade parts and counting. Why? Your business, your school, your passion cant flourish when your technology needs repairs. Neither can ours. \n\nLulzBot hardware is made in the USA using domestic and imported parts. Our unwavering commitment to quality means your equipment will be enjoyed for years to come with minimal maintenance.\n\nGet fast and friendly help whenever you need it from our industry leading \u0026 Colorado-based technical support team: LulzBot.com/Support\n\nLearn more at https://www.lulzbot.com/about-lulzbot-3d-printers.\n\n\n Find Us Online \nSubscribe for more 3D printing tips, tricks, and tutorials: https://www.youtube.com/subscription_center?add_user=LulzBotVideo\nInstagram: https://www.instagram.com/lulzbot3d/\nFacebook: https://www.facebook.com/LulzBot\nTwitter: https://twitter.com/lulzbot3d\nGoogle+: https://plus.google.com/+Lulzbot3D/posts\nLinkedIn: https://www.linkedin.com/company/lulzbot"},"lengthSeconds":"199","ownerProfileUrl":"http://www.youtube.com/user/LulzBotVideo","externalChannelId":"UC5cVl4bzPKm-uyahKzkXNVg","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO
